/**
 * This is an abstract class that is not intended to be used directly. Extend it to turn your class into an enum
 * (initialization is performed via `MyClass.initEnum()`).
 *
 * Modified from source provided by enumify (license unlisted / public domain)
 * @see https://github.com/rauschma/enumify
 */
export default class Enum
{
   /**
    * `initEnum()` closes the class. Then calling this constructor throws an exception.
    *
    * If your subclass has a constructor then you can control what properties are added to `this` via the argument you
    * pass to `super()`. No arguments are fine, too.
    *
    * @param {object}   instanceProperties - Provides initial properties.
    */
   constructor(instanceProperties = void 0)
   {
      // new.target would be better than this.constructor, but isn’t supported by Babel
      if ({}.hasOwnProperty.call(this.constructor, INITIALIZED))
      {
         throw new Error('Enum classes can’t be instantiated');
      }

      if (typeof instanceProperties === 'object' && instanceProperties !== null)
      {
         s_COPY_PROPERTIES(this, instanceProperties);
      }
   }

   /**
    * Set up the enum, close the class.
    *
    * @param {Array|object}   arg - Either an object whose properties provide the names and values (which must be
    * mutable objects) of the enum constants. Or an Array whose elements are used as the names of the enum constants.
    * The values are create by instantiating the current class.
    *
    * @returns {Enum}
    */
   static initEnum(arg)
   {
      Object.defineProperty(this, 'enumValues',
      {
         value: [],
         configurable: false,
         writable: false,
         enumerable: true
      });

      if (Array.isArray(arg))
      {
         this._enumValuesFromArray(arg);
      }
      else
      {
         this._enumValuesFromObject(arg);
      }

      Object.freeze(this.enumValues);
      this[INITIALIZED] = true;

      return this;
   }

   static _enumValuesFromArray(arr)
   {
      for (const key of arr) { this._pushEnumValue(new this(), key); }
   }

   static _enumValuesFromObject(obj)
   {
      for (const key of Object.keys(obj))
      {
         const value = new this(obj[key]);
         this._pushEnumValue(value, key);
      }
   }

   static _pushEnumValue(enumValue, name)
   {
      enumValue.name = name;
      enumValue.ordinal = this.enumValues.length;

      Object.defineProperty(this, name,
      {
         value: enumValue,
         configurable: false,
         writable: false,
         enumerable: true
      });

      this.enumValues.push(enumValue);
   }

   /**
    * Given the name of an enum constant, return its value.
    *
    * @param {string}   name - An enum name.
    *
    * @returns {T}
    */
   static enumValueOf(name)
   {
      return this.enumValues.find((x) => x.name === name);
   }

   /**
    * Make enum classes iterable
    *
    * @returns {Symbol.iterator}
    */
   static [Symbol.iterator]()
   {
      return this.enumValues[Symbol.iterator]();
   }

   /**
    * Default `toString()` method for enum constant.
    *
    * @returns {string}
    */
   toString()
   {
      return `${this.constructor.name}.${this.name}`;
   }
}

// Module private ---------------------------------------------------------------------------------------------------

/**
 * Provides a Symbol to track initialized state.
 * @type {Symbol}
 * @ignore
 */
const INITIALIZED = Symbol();

/**
 * Copies an objects properties.
 *
 * @param {object}   target - Target object.
 * @param {object}   source - Source object.
 *
 * @returns {object}
 * @ignore
 */
function s_COPY_PROPERTIES(target, source)
{
   // Ideally, we’d use Reflect.ownKeys() here, but I don’t want to depend on a polyfill.
   for (const key of Object.getOwnPropertyNames(source))
   {
      const desc = Object.getOwnPropertyDescriptor(source, key);
      Object.defineProperty(target, key, desc);
   }

   return target;
}

import ObjectUtil from './ObjectUtil';

/**
 * Provides common math utilities.
 */
export default class MathUtil
{
   /**
    * Compacts a 2D matrix testing entries against a testValue with a default value of `1` for inclusion. The resulting
    * compacted array only has object hash entries for rows that contain column entries that pass the test. Each entry
    * has a `row` entry as a number corresponding to a row index and a `cols` entry which is an array of numbers
    * representing all column indexes that pass the test. This works well for large sparse matrices.
    *
    * @param {Array<Array<number>>} matrix - A matrix to compact / compress.
    * @param {*}                    testValue - A value to test strict equality to include entry for compaction.
    *
    * @returns {Array<{row: number, cols: Array<number>}>}
    */
   static compactMatrix(matrix, testValue = 1)
   {
      const compacted = [];

      matrix.forEach((rowEntry, row) =>
      {
         const cols = [];

         rowEntry.forEach((colEntry, colIndex) => { if (colEntry === testValue) { cols.push(colIndex); } });

         if (cols.length > 0) { compacted.push({ row, cols }); }
      });

      return compacted;
   }

   /**
    * Creates an 2-dimensional array of the given length.
    *
    * @param {number}   length - Array length for x / y dimensions.
    * @param {number}   value - Default value.
    *
    * @return {Array<Array<number>>}
    */
   static create2DArray(length = 0, value = 0)
   {
      const array = new Array(length);

      for (let cntr = 0; cntr < length; cntr++) { array[cntr] = new Array(length); }

      for (let i = 0; i < length; i++)
      {
         for (let j = 0; j < length; j++) { array[i][j] = value; }
      }

      return array;
   }

   /**
    * Returns the median / middle value from the given array after sorting numerically. If values length is odd the
    * middle value in the array is returned otherwise if even two middle values are summed then divided by 2.
    *
    * @param {Array<number>}  values - An Array of numerical values.
    *
    * @returns {number}
    */
   static getMedian(values)
   {
      // Sort by number.
      values.sort((lhs, rhs) => { return lhs - rhs; });

      // Checks of values.length is odd.
      if (values.length % 2) { return values[(values.length - 1) / 2]; }

      return (values[(values.length - 2) / 2] + values[values.length / 2]) / 2;
   }

   /**
    * Returns the percent of a given value and limit.
    *
    * @param {number}   value - A `value` to calculate the percentage against the given `limit`.
    * @param {number}   limit - A base `limit` that constrains the `value`.
    *
    * @returns {number}
    */
   static getPercent(value, limit)
   {
      return limit === 0 ? 0 : (value / limit) * 100;
   }

   /**
    * Performs a naive depth traversal of an object / array. The data structure _must not_ have circular references.
    * The result of the `toFixed` method is invoked for each leaf or array entry modifying any floating point number
    * in place.
    *
    * @param {object}   data - An object or array.
    *
    * @returns {*}
    */
   static toFixedTraverse(data)
   {
      return ObjectUtil.depthTraverse(data, MathUtil.toFixed);
   }

   /**
    * Converts floating point numbers to a fixed decimal length of 3. This saves space and avoids precision
    * issues with serializing / deserializing.
    *
    * @param {*}  val - Any value; only floats are processed.
    *
    * @returns {*}
    */
   static toFixed(val)
   {
      return typeof val === 'number' && !Number.isInteger(val) ? Math.round(val * 1000) / 1000 : val;
   }
}

/**
 * Provides common object manipulation utilities.
 */
export default class ObjectUtil
{
   /**
    * Performs a naive depth traversal of an object / array. The data structure _must not_ have circular references.
    * The result of the callback function is used to modify in place the given data.
    *
    * @param {object|Array}   data - An object or array.
    * @param {function}       func - A callback function to process leaf values in children arrays or object members.
    *
    * @returns {*}
    */
   static depthTraverse(data, func)
   {
      /* istanbul ignore if */
      if (typeof data !== 'object') { throw new TypeError('depthTraverse error: \'data\' is not an \'object\'.'); }

      /* istanbul ignore if */
      if (typeof func !== 'function') { throw new TypeError('depthTraverse error: \'func\' is not a \'function\'.'); }

      return _depthTraverse(data, func);
   }

   /**
    * Returns a list of accessor keys by traversing the given object.
    *
    * @param {object}   data - An object to traverse for accessor keys.
    *
    * @returns {Array}
    */
   static getAccessorList(data)
   {
      if (typeof data !== 'object') { throw new TypeError(`getAccessorList error: 'data' is not an 'object'.`); }

      return _getAccessorList(data);
   }

   /**
    * Provides a way to safely access an objects data / entries given an accessor string which describes the
    * entries to walk. To access deeper entries into the object format the accessor string with `.` between entries
    * to walk.
    *
    * @param {object}   data - An object to access entry data.
    * @param {string}   accessor - A string describing the entries to access.
    * @param {*}        defaultValue - (Optional) A default value to return if an entry for accessor is not found.
    *
    * @returns {*}
    */
   static safeAccess(data, accessor, defaultValue = void 0)
   {
      if (typeof data !== 'object') { return defaultValue; }
      if (typeof accessor !== 'string') { return defaultValue; }

      const access = accessor.split('.');

      // Walk through the given object by the accessor indexes.
      for (let cntr = 0; cntr < access.length; cntr++)
      {
         // If the next level of object access is undefined or null then return the empty string.
         if (typeof data[access[cntr]] === 'undefined' || data[access[cntr]] === null) { return defaultValue; }

         data = data[access[cntr]];
      }

      return data;
   }

   /**
    * Compares a source object and values of entries against a target object. If the entries in the source object match
    * the target object then `true` is returned otherwise `false`. If either object is undefined or null then false
    * is returned.
    *
    * @param {object}   source - Source object.
    * @param {object}   target - Target object.
    *
    * @returns {boolean}
    */
   static safeEqual(source, target)
   {
      if (typeof source === 'undefined' || source === null || typeof target === 'undefined' || target === null)
      {
         return false;
      }

      const sourceAccessors = ObjectUtil.getAccessorList(source);

      for (let cntr = 0; cntr < sourceAccessors.length; cntr++)
      {
         const accessor = sourceAccessors[cntr];

         const sourceObjectValue = ObjectUtil.safeAccess(source, accessor);
         const targetObjectValue = ObjectUtil.safeAccess(target, accessor);

         if (sourceObjectValue !== targetObjectValue) { return false; }
      }

      return true;
   }

   /**
    * Provides a way to safely set an objects data / entries given an accessor string which describes the
    * entries to walk. To access deeper entries into the object format the accessor string with `.` between entries
    * to walk.
    *
    * @param {object}   data - An object to access entry data.
    * @param {string}   accessor - A string describing the entries to access.
    * @param {*}        value - A new value to set if an entry for accessor is found.
    * @param {string}   operation - (Optional) Operation to perform including: 'add', 'div', 'mult', 'set', 'sub';
    *                               default (`set`).
    *
    * @returns {boolean} True if successful.
    */
   static safeSet(data, accessor, value, operation = 'set')
   {
      if (typeof data !== 'object') { throw new TypeError(`safeSet Error: 'data' is not an 'object'.`); }
      if (typeof accessor !== 'string') { throw new TypeError(`safeSet Error: 'accessor' is not a 'string'.`); }

      const access = accessor.split('.');

      // Walk through the given object by the accessor indexes.
      for (let cntr = 0; cntr < access.length; cntr++)
      {
         // If the next level of object access is undefined then create a new object entry.
         if (typeof data[access[cntr]] === 'undefined') { data[access[cntr]] = {}; }

         if (cntr === access.length - 1)
         {
            switch (operation)
            {
               case 'add':
                  data[access[cntr]] += value;
                  break;

               case 'div':
                  data[access[cntr]] /= value;
                  break;

               case 'mult':
                  data[access[cntr]] *= value;
                  break;

               case 'set':
                  data[access[cntr]] = value;
                  break;

               case 'sub':
                  data[access[cntr]] -= value;
                  break;
            }
         }
         else
         {
            // Abort if the next level is null or not an object and containing a value.
            if (data[access[cntr]] === null || typeof data[access[cntr]] !== 'object') { return false; }

            data = data[access[cntr]];
         }
      }

      return true;
   }
}

// Module private ---------------------------------------------------------------------------------------------------

/**
 * Private implementation of depth traversal.
 *
 * @param {object|Array}   data - An object or array.
 * @param {function}       func - A callback function to process leaf values in children arrays or object members.
 *
 * @returns {*}
 * @ignore
 * @private
 */
function _depthTraverse(data, func)
{
   if (Array.isArray(data))
   {
      for (let cntr = 0; cntr < data.length; cntr++) { data[cntr] = _depthTraverse(data[cntr], func); }
   }
   else if (typeof data === 'object')
   {
      for (const key in data) { if (data.hasOwnProperty(key)) { data[key] = _depthTraverse(data[key], func); } }
   }
   else
   {
      data = func(data);
   }

   return data;
}

/**
 * Private implementation of `getAccessorList`.
 *
 * @param {object}   data - An object to traverse.
 *
 * @returns {Array}
 * @ignore
 * @private
 */
function _getAccessorList(data)
{
   const accessors = [];

   for (const key in data)
   {
      if (data.hasOwnProperty(key))
      {
         if (typeof data[key] === 'object')
         {
            const childKeys = _getAccessorList(data[key]);

            childKeys.forEach((childKey) =>
            {
               accessors.push(Array.isArray(childKey) ? `${key}.${childKey.join('.')}` : `${key}.${childKey}`);
            });
         }
         else
         {
            accessors.push(key);
         }
      }
   }

   return accessors;
}

import ObjectUtil from './ObjectUtil';

/**
 * Provides common string utilities.
 */
export default class StringUtil
{
   /**
    * Compares two strings.
    *
    * @param {string}   lhs - Left-hand side.
    * @param {string}   rhs - Right-hand side.
    *
    * @returns {number}
    */
   static compare(lhs, rhs)
   {
      return lhs.toLowerCase().localeCompare(rhs.toLowerCase());
   }

   /**
    * Increments the indentation amount.
    *
    * @param {number}   indentation - Current indentation amount.
    * @param {number}   amount - (Optional) indentation amount; default: 3.
    *
    * @returns {number}
    */
   static incrementIndent(indentation, amount = 3)
   {
      return indentation + amount;
   }

   /**
    * Creates an indentation string given the indentation amount.
    *
    * @param {number}   indentation - Current indentation amount.
    * @param {string}   string - A string to append.
    *
    * @returns {string}
    */
   static indent(indentation, string = '')
   {
      return (new Array(indentation + 1)).join(' ') + string;
   }

   /**
    * Returns the SafeEntry constructor which is used by `safeStringsObject` and `safeStringsPrependObject`.
    *
    * @returns {SafeEntry}
    */
   static get SafeEntry() { return SafeEntry; }

   /**
    * Provides a way to output a given string value with concatenated data from safely accessing an objects data /
    * entries given an accessor string which describes the entries to walk. To access deeper entries into the object
    * format the accessor string with `.` between entries to walk.
    *
    * @param {string}   string - A string to prepend to the object data received.
    * @param {object}   object - An object to access entry data.
    * @param {string}   accessor - A string describing the entries to access.
    * @param {number}   newLine - (Optional) A number of new line characters to append; default: `1`.
    * @param {string}   appendString - (Optional) A string to potentially append; default: `''`;
    * @param {function} tagFunction - (Optional) A template tag function to apply; default: `void 0`;
    *
    * @returns {string}
    */
   static safeStringObject(string, object, accessor, newLine = 1, appendString = '', tagFunction = void 0)
   {
      const value = ObjectUtil.safeAccess(object, accessor);

      if (typeof value === 'undefined' || (Array.isArray(value) && value.length === 0)) { return ''; }

      let end = '\n';

      // Create the ending new line result if it is not the default of `1`.
      if (newLine === 0 || newLine > 1) { end = new Array(newLine + 1).join('\n'); }

      return typeof tagFunction === 'function' ? tagFunction`${string}${value}${appendString}${end}` :
       `${string}${value}${appendString}${end}`;
   }

   /**
    * Provides a convenience method producing a block of `safeStringObject` results.
    *
    * @param {object}         object - An object to access entry data.
    *
    * @param {string|SafeEntry|Array<string|SafeEntry>} entries -
    *                                  Multiple arrays or strings. If an entry is not a SafeEntry it will
    *                                  simply be appended. If the entry is an array then entries in this array
    *                                  correspond to the following parameters which are forwarded onto
    *                                  `safeStringObject`.
    *
    * @returns {string}
    */
   static safeStringsObject(object, ...entries)
   {
      return StringUtil.safeStringsPrependObject('', object, ...entries);
   }

   /**
    * Provides a convenience method producing a block of `safeStringObject` results with the option to prepend a
    * given string.
    *
    * @param {*}              origPrepend - An additional value to prepend to all results.
    *
    * @param {object}         object - An object to access entry data.
    *
    * @param {string|SafeEntry|Array<string|SafeEntry>} entries -
    *                                  Multiple arrays or strings. If an entry is not a SafeEntry it will
    *                                  simply be appended. If the entry is an array then entries in this array
    *                                  correspond to the following parameters which are forwarded onto
    *                                  `safeStringObject`.
    *
    * @returns {string}
    */
   static safeStringsPrependObject(origPrepend, object, ...entries)
   {
      if (typeof object !== 'object') { return ''; }

      const output = [];

      let skipPrepend = false;

      for (let cntr = 0; cntr < entries.length; cntr++)
      {
         const entry = entries[cntr];

         // Skip prepend action if last entry did not include a new line.
         const prepend = skipPrepend ? '' : origPrepend;

         // Process an array entry otherwise simply append `entry` to output if it is a string.
         if (entry instanceof SafeEntry)
         {
            skipPrepend = entry.newLine === 0;

            output.push(StringUtil.safeStringObject(`${prepend}${entry.prependString}`,
             object, entry.accessor, entry.newLine, entry.appendString, entry.tagFunction));
         }
         else if (typeof entry === 'string' && entry !== '')
         {
            output.push(`${prepend}${entry}`);
         }
         else if (typeof entry.toString === 'function')
         {
            const stringValue = entry.toString();

            if (stringValue !== '')
            {
               output.push(`${prepend}${stringValue}`);
            }
         }
      }

      return output.join('');
   }

   /**
    * Provides a tagged template method to escape HTML elements.
    *
    * @param {Array<string>}  literal - Literal components of template string.
    * @param {Array<*>}       values - Values to substitute.
    *
    * @returns {string}
    */
   static tagEscapeHTML(literal, ...values)
   {
      return values.reduce((previous, value, index) =>
      {
         return previous + String(value).replace(/</g, '&lt;').replace(/>/g, '&gt;') + literal[index + 1];
      }, literal[0]);
   }
}

/**
 * Defines the parameters for a safe string object lookup. If the accessor resolves against a given object then
 * a string is created by combining the prepend / append strings between the value with optional new lines appended
 * at the end. If a template tag function is defined it is applied to the template string.
 */
class SafeEntry
{
   /**
    * Initializes SafeEntry instance.
    *
    * @param {string}   prependString - The string to prepend.
    * @param {string}   accessor - The accessor string describing the lookup operation.
    * @param {number}   newLine - (Optional) The number of newlines characters to append.
    * @param {string}   appendString - (Optional) A string to append to the end.
    * @param {function} tagFunction - (Optional) A template tag function to apply.
    */
   constructor(prependString, accessor, newLine = 1, appendString = '', tagFunction = void 0)
   {
      if (typeof prependString !== 'string') { throw new TypeError(`ctor error: 'prependString' is not a 'string'.`); }
      if (typeof accessor !== 'string') { throw new TypeError(`ctor error: 'accessor' is not a 'string'.`); }
      if (typeof appendString !== 'string') { throw new TypeError(`ctor error: 'appendString' is not a 'string'.`); }

      if (typeof tagFunction !== 'function' && typeof tagFunction !== 'undefined')
      {
         throw new TypeError(`ctor error: 'tagFunction' is not a 'function' or 'undefined'.`);
      }

      if (Number.isInteger(newLine) && newLine < 0)
      {
         throw new TypeError(`ctor error: 'newLine' is not a positive 'integer' (${newLine}).`);
      }

      /**
       * The string to prepend.
       * @type {string}
       * @private
       */
      this._prependString = prependString;

      /**
       * The accessor string describing the lookup operation.
       * @type {string}
       * @private
       */
      this._accessor = accessor;

      /**
       * The number of newlines characters to append.
       * @type {number}
       * @private
       */
      this._newLine = newLine;

      /**
       * A string to append to the end.
       * @type {string}
       * @private
       */
      this._appendString = appendString;

      /**
       * A template tag function to apply.
       * @type {Function}
       * @private
       */
      this._tagFunction = tagFunction;
   }

   /**
    * Returns the accessor string describing the lookup operation.
    * @returns {string}
    */
   get accessor() { return this._accessor; }

   /**
    * Returns a string to append to the end if any.
    * @returns {string}
    */
   get appendString() { return this._appendString; }

   /**
    * Returns the new line count.
    * @returns {number}
    */
   get newLine() { return this._newLine; }

   /**
    * Returns the string to prepend.
    * @returns {string}
    */
   get prependString() { return this._prependString; }

   /**
    * Returns a template tag function to apply if any.
    * @returns {Function}
    */
   get tagFunction() { return this._tagFunction; }
}

/**
 * Defines the output data from parsing an AST tree.
