         }
      }

      output.write(' => ');
      output.operators.push('function=>');

      if (node.body.type[0] === 'O')
      {
         output.write('(');

         this.ObjectExpression(node.body, state);

         output.write(')');
      }
      else
      {
         this[node.body.type](node.body, state);
      }
   },

   ThisExpression(node, state)
   {
      state.output.write('this');
      state.output.operators.push('this');
   },

   Super(node, state)
   {
      state.output.write('super');
      state.output.operators.push('super');
   },

   RestElement(node, state)
   {
      state.output.write('...');
      state.output.operators.push('... (rest)');

      this[node.argument.type](node.argument, state);
   },

   SpreadElement(node, state)
   {
      state.output.write('...');
      state.output.operators.push('... (spread)');
      this[node.argument.type](node.argument, state);
   },

   YieldExpression(node, state)
   {
      const { output } = state;

      output.write(node.delegate ? 'yield*' : 'yield');
      output.operators.push(node.delegate ? 'yield*' : 'yield');

      if (node.argument)
      {
         output.write(' ');

         this[node.argument.type](node.argument, state);
      }
   },

   TemplateLiteral(node, state)
   {
      const { output } = state;
      const { quasis, expressions } = node;
      const { length } = expressions;

      output.write('`');

      for (let i = 0; i < length; i++)
      {
         const expression = expressions[i];

         output.write(quasis[i].value.raw);
         output.write('${');

         this[expression.type](expression, state);

         output.write('}');
      }

      output.write(quasis[quasis.length - 1].value.raw);
      output.write('`');
   },

   TaggedTemplateExpression(node, state)
   {
      this[node.tag.type](node.tag, state);
      this[node.quasi.type](node.quasi, state);
   },

   ArrayExpression: ArrayExpression = function(node, state)
   {
      const { output } = state;

      output.operators.push('[]');
      output.write('[');

      if (node.elements.length > 0)
      {
         const { elements } = node, { length } = elements;

         for (let i = 0; ;)
         {
            const element = elements[i];

            if (element != null) { this[element.type](element, state); }

            if (++i < length)
            {
               output.write(', ');
            }
            else
            {
               if (element == null) { output.write(', '); }
               break;
            }
         }
      }

      output.write(']');
   },

   ArrayPattern: ArrayExpression,

   ObjectExpression(node, state)
   {
      const indent = state.indent.repeat(state.indentLevel++);
      const { lineEnd, output } = state;
      const propertyIndent = indent + state.indent;

      output.operators.push('{}');
      output.write('{');

      if (node.properties.length > 0)
      {
         output.write(lineEnd);

         const comma = `,${lineEnd}`, { properties } = node, { length } = properties;

         for (let i = 0; ;)
         {
            const property = properties[i];

            output.write(propertyIndent);

            this.Property(property, state);

            if (++i < length)
            {
               output.write(comma);
            }
            else
            {
               break;
            }
         }

         output.write(lineEnd);
         output.write(`${indent}}`);
      }
      else
      {
         output.write('}');
      }

      state.indentLevel--;
   },

   Property(node, state)
   {
      if (node.method || node.kind[0] !== 'i')
      {
         this.MethodDefinition(node, state); // Either a method or of kind `set` or `get` (not `init`)
      }
      else
      {
         const { output } = state;

         if (!node.shorthand)
         {
            if (node.computed)
            {
               output.operators.push('[]');
               output.write('[');

               this[node.key.type](node.key, state);

               output.write(']');
            }
            else
            {
               this[node.key.type](node.key, state);
            }

            output.operators.push(':');
            output.write(': ');
         }

         this[node.value.type](node.value, state);
      }
   },

   ObjectPattern(node, state)
   {
      const { output } = state;

      output.operators.push('{}');
      output.write('{');

      if (node.properties.length > 0)
      {
         const { properties } = node, { length } = properties;

         for (let i = 0; ;)
         {
            this.Property(properties[i], state);

            if (++i < length)
            {
               output.write(', ');
            }
            else
            {
               break;
            }
         }
      }
      output.write('}');
   },

   SequenceExpression(node, state)
   {
      ASTUtil.formatSequence(node.expressions, state, this);
   },

   UnaryExpression(node, state)
   {
      const { output } = state;

      output.operators.push(`${node.operator} (${node.prefix ? 'pre' : 'post'}fix)`);

      if (node.prefix)
      {
         output.write(node.operator);

         if (node.operator.length > 1) { output.write(' '); }

         if (expressionPrecedence[node.argument.type] < expressionPrecedence.UnaryExpression)
         {
            output.write('(');

            this[node.argument.type](node.argument, state);

            output.write(')');
         }
         else
         {
            this[node.argument.type](node.argument, state);
         }
      }
      else
      {
         // FIXME: This case never occurs
         this[node.argument.type](node.argument, state);

         state.output.write(node.operator);
      }
   },

   UpdateExpression(node, state)
   {
      // Always applied to identifiers or members, no parenthesis check needed
      state.output.operators.push(`${node.operator} (${node.prefix ? 'pre' : 'post'}fix)`);

      if (node.prefix)
      {
         state.output.write(node.operator);

         this[node.argument.type](node.argument, state);
      }
      else
      {
         this[node.argument.type](node.argument, state);

         state.output.write(node.operator);
      }
   },

   AssignmentExpression(node, state)
   {
      this[node.left.type](node.left, state);

      state.output.write(` ${node.operator} `);

      this[node.right.type](node.right, state);

      state.output.operators.push(node.operator);
   },

   AssignmentPattern(node, state)
   {
      this[node.left.type](node.left, state);

      state.output.write(' = ');

      this[node.right.type](node.right, state);

      state.output.operators.push('=');
   },

   BinaryExpression: BinaryExpression = function(node, state)
   {
      const { output } = state;

      output.operators.push(node.operator);

      if (node.operator === 'in')
      {
         // Avoids confusion in `for` loops initializers
         output.write('(');

         ASTUtil.formatBinaryExpressionPart(node.left, node, false, state, this);

         output.write(` ${node.operator} `);

         ASTUtil.formatBinaryExpressionPart(node.right, node, true, state, this);

         output.write(')');
      }
      else
      {
         ASTUtil.formatBinaryExpressionPart(node.left, node, false, state, this);

         output.write(` ${node.operator} `);

         ASTUtil.formatBinaryExpressionPart(node.right, node, true, state, this);
      }
   },

   LogicalExpression: BinaryExpression,

   ConditionalExpression(node, state)
   {
      const { output } = state;

      if (expressionPrecedence[node.test.type] > expressionPrecedence.ConditionalExpression)
      {
         this[node.test.type](node.test, state);
      }
      else
      {
         output.operators.push('()');
         output.write('(');

         this[node.test.type](node.test, state);

         output.write(')');
      }

      output.write(' ? ');

      this[node.consequent.type](node.consequent, state);

      output.write(' : ');

      this[node.alternate.type](node.alternate, state);

      output.operators.push(':?');
   },

   NewExpression(node, state)
   {
      const { output } = state;

      output.write('new ');
      output.operators.push('new');

      if (expressionPrecedence[node.callee.type] < expressionPrecedence.CallExpression ||
       ASTUtil.hasCallExpression(node.callee))
      {
         output.write('(');

         this[node.callee.type](node.callee, state);

         output.write(')');

         output.operators.push('()');
      }
      else
      {
         this[node.callee.type](node.callee, state);
      }

      ASTUtil.formatSequence(node['arguments'], state, this);
   },

   CallExpression(node, state)
   {
      const { output } = state;

      if (expressionPrecedence[node.callee.type] < expressionPrecedence.CallExpression)
      {
         output.write('(');

         this[node.callee.type](node.callee, state);

         output.write(')');
         output.operators.push('()');
      }
      else
      {
         this[node.callee.type](node.callee, state);
      }

      ASTUtil.formatSequence(node['arguments'], state, this);
   },

   MemberExpression(node, state)
   {
      const { output } = state;

      if (expressionPrecedence[node.object.type] < expressionPrecedence.MemberExpression)
      {
         output.write('(');

         this[node.object.type](node.object, state);

         output.write(')');
         output.operators.push('()');
      }
      else
      {
         this[node.object.type](node.object, state);
      }

      if (node.computed)
      {
         output.write('[');

         this[node.property.type](node.property, state);

         output.write(']');

         output.operators.push('[]');
      }
      else
      {
         output.write('.');
         output.operators.push('.');

         this[node.property.type](node.property, state);
      }
   },

   MetaProperty(node, state)
   {
      state.output.write(`${node.meta.name}.${node.property.name}`);

      state.output.operators.push('.');
      state.output.operands.push(node.meta.name);
      state.output.operands.push(node.property.name);
   },

   Identifier(node, state)
   {
      state.output.write(node.name);
      state.output.operands.push(node.name);
   },

   Literal(node, state)
   {
      if (node.raw != null)
      {
         state.output.write(node.raw);
         state.output.operands.push(node.raw);
      }
      else if (node.regex != null)
      {
         this.RegExpLiteral(node, state);
      }
      else
      {
         state.output.write(JSON.stringify(node.value));
      }
   },

   RegExpLiteral(node, state)
   {
      const { regex } = node;

      state.output.write(`new RegExp(${JSON.stringify(regex.pattern)}, ${JSON.stringify(regex.flags)})`);
   },

   // Babylon AST nodes ---------------------------------------------------------------------------------------------

   BooleanLiteral(node, state)
   {
      state.output.write(node.value);
      state.output.operands.push(node.value);
   },

   DirectiveLiteral(node, state)
   {
      state.output.write(node.value);
      state.output.operands.push(node.value);
   },

   NullLiteral(node, state)
   {
      state.output.write('null');
      state.output.operands.push('null');
   },

   NumericLiteral(node, state)
   {
      state.output.write(node.value);
      state.output.operands.push(node.value);
   },

   StringLiteral(node, state)
   {
      if (node.extra != null && node.extra.raw != null)
      {
         state.output.write(node.extra.raw);
         state.output.operands.push(node.extra.raw);
      }
      else
      {
         state.output.write(JSON.stringify(node.value));
         state.output.operands.push(JSON.stringify(node.value));
      }
   }
};

import { assert }             from 'chai';

import AbstractSyntaxLoader   from '../../../src/module/plugin/syntax/AbstractSyntaxLoader';

import * as testconfig        from '../testconfig';

class Parent extends AbstractSyntaxLoader
{
   ParentOne() { return {}; }
   ParentTwo() { return {}; }
}

class Child extends Parent
{
   onConfigure() { return {}; } // This is ignored by AbstractSyntaxLoader.
   ChildThree() { return {}; }
   ChildFour() { return {}; }
}

if (testconfig.modules['modulePlugin'])
{
   suite('plugin:', () =>
   {
      /**
       * Verifies that AbstractSyntaxLoader can find all child / parent inheritance methods
       */
      suite('syntax (AbstractSyntaxLoader):', () =>
      {
         const instance = new Child();

         test('verify child / parent syntax loading', () =>
         {
            const event = { data: { settings: {}, syntaxes: {} } };
            instance.onLoadSyntax(event);

            assert.isUndefined(event.data.syntaxes['onConfigure']);

            assert.isObject(event.data.syntaxes['ChildThree']);
            assert.isObject(event.data.syntaxes['ChildFour']);
            assert.isObject(event.data.syntaxes['ParentOne']);
            assert.isObject(event.data.syntaxes['ParentTwo']);
         });
      });
   });
}

import { assert }       from 'chai';

import ClassReport      from '../../../src/module/report/ClassReport';
import MethodReport     from '../../../src/module/report/MethodReport';
import ModuleReport     from '../../../src/module/report/ModuleReport';

import * as testconfig  from '../testconfig';

if (testconfig.modules['moduleReport'])
{
   suite('report:', () =>
   {
      suite('ModuleReport:', () =>
      {
         suite('instantiation:', () =>
         {
            let report;

            setup(() => { report = new ModuleReport(10, 100); });
            teardown(() => { report = undefined; });

            test('report has correct line start / end', () =>
            {
               assert.strictEqual(report.lineStart, 10);
               assert.strictEqual(report.lineEnd, 100);
            });
         });

         suite('addDependencies:', () =>
         {
            let report;

            setup(() => { report = new ModuleReport(10, 100); });
            teardown(() => { report = undefined; });

            test('report has correct dependencies', () =>
            {
               report.addDependencies({ type: 'esm' });

               assert.lengthOf(report.dependencies, 1);
            });
         });

         suite('createScope / popScope:', () =>
         {
            let report;

            setup(() => { report = new ModuleReport(10, 100); });
            teardown(() => { report = undefined; });

            test('report has correct class scope', () =>
            {
               assert.isUndefined(report.getCurrentClassReport());

               let classReport = report.createScope('class', 100, 200);
               let classReport2 = report.getCurrentClassReport();

               assert.instanceOf(classReport, ClassReport);
               assert.instanceOf(classReport2, ClassReport);

               assert.lengthOf(report.classes, 1);

               assert.strictEqual(classReport, classReport2);

               classReport = report.popScope('class');
               classReport2 = report.getCurrentClassReport();

               assert.isUndefined(classReport);
               assert.isUndefined(classReport2);
            });

            test('report has correct method scope', () =>
            {
               assert.isUndefined(report.getCurrentMethodReport());

               let methodReport = report.createScope('method', 100, 200);
               let methodReport2 = report.getCurrentMethodReport();

               assert.instanceOf(methodReport, MethodReport);
               assert.instanceOf(methodReport2, MethodReport);

               assert.lengthOf(report.methods, 1);

               assert.strictEqual(methodReport, methodReport2);

               methodReport = report.popScope('method');
               methodReport2 = report.getCurrentMethodReport();

               assert.isUndefined(methodReport);
               assert.isUndefined(methodReport2);
            });

            test('report has correct class w/ method scope', () =>
            {
               report.createScope('class', 100, 200);
               report.createScope('method', 100, 200, 4);

               assert.lengthOf(report.classes, 1);
               assert.lengthOf(report.classes[0].methods, 1);

               assert.lengthOf(report.methods, 0);
            });

            test('error thrown for unknown scope type', () =>
            {
               assert.throws(() => { report.createScope('unknown', 100, 200); });
               assert.throws(() => { report.popScope('unknown'); });
            });

            test('scope stacks are not defined', () =>
            {
               assert.isNotArray(report._scopeStackClass);
               assert.isNotArray(report._scopeStackMethod);
               report.finalize();
               assert.isNotArray(report._scopeStackClass);
               assert.isNotArray(report._scopeStackMethod);
            });

            test('class scope stack created / finalized', () =>
            {
               report.createScope('class', 100, 200);

               assert.isArray(report._scopeStackClass);
               assert.isNotArray(report._scopeStackMethod);

               report.finalize();

               assert.isNotArray(report._scopeStackClass);
               assert.isNotArray(report._scopeStackMethod);
            });

            test('method scope stack created / finalized', () =>
            {
               report.createScope('method', 100, 200, 4);

               assert.isNotArray(report._scopeStackClass);
               assert.isArray(report._scopeStackMethod);

               report.finalize();

               assert.isNotArray(report._scopeStackClass);
               assert.isNotArray(report._scopeStackMethod);
            });
         });

         suite('halsteadItemEncountered:', () =>
         {
            let report;

            setup(() => { report = new ModuleReport(10, 100); });
            teardown(() => { report = undefined; });

            test('report has correct class w/ method halstead metrics', () =>
            {
               report.createScope('class', 100, 200);
               report.createScope('method', 100, 200, 0);

               report.halsteadItemEncountered('operators', 'test');

               assert.strictEqual(report.methodAggregate.halstead.operators.identifiers[0], 'test');
               assert.strictEqual(report.classes[0].methodAggregate.halstead.operators.identifiers[0], 'test');
               assert.strictEqual(report.classes[0].methods[0].halstead.operators.identifiers[0], 'test');
            });
         });

         suite('incrementCyclomatic:', () =>
         {
            let report;

            setup(() => { report = new ModuleReport(10, 100); });
            teardown(() => { report = undefined; });

            test('report has correct class w/ method cyclomatic metrics', () =>
            {
               report.createScope('class', 100, 200);
               report.createScope('method', 100, 200, 0);

               report.incrementCyclomatic(50);

               assert.strictEqual(report.methodAggregate.cyclomatic, 51);
               assert.strictEqual(report.classes[0].methodAggregate.cyclomatic, 51);
               assert.strictEqual(report.classes[0].methods[0].cyclomatic, 51);
            });
         });

         suite('incrementLogicalSloc:', () =>
         {
            let report;

            setup(() => { report = new ModuleReport(10, 100); });
            teardown(() => { report = undefined; });

            test('report has correct class w/ method sloc metrics', () =>
            {
               report.createScope('class', 100, 200);
               report.createScope('method', 100, 200, 0);

               report.incrementLogicalSloc(50);

               assert.strictEqual(report.methodAggregate.sloc.logical, 50);
               assert.strictEqual(report.classes[0].methodAggregate.sloc.logical, 50);
               assert.strictEqual(report.classes[0].methods[0].sloc.logical, 50);
            });
         });
      });

      suite('AbstractReport:', () =>
      {
         let report;

         setup(() => { report = new ModuleReport(10, 100); });
         teardown(() => { report = undefined; });

         test('report methodAggregate has correct params count', () =>
         {
            report.incrementParams(20);
            assert.strictEqual(report.methodAggregate.params, 20);
         });
      });

      suite('HalsteadData:', () =>
      {
         let report;

         setup(() => { report = new ModuleReport(10, 100); });
         teardown(() => { report = undefined; });

         test('report methodAggregate halstead data is reset', () =>
         {
            report.methodAggregate.halstead.bugs = 1000;
            report.methodAggregate.halstead.operands.distinct = 1000;
            report.methodAggregate.halstead.operands.identifiers.push('test');
            report.methodAggregate.halstead.reset(true);
            assert.strictEqual(report.methodAggregate.halstead.bugs, 0);
            assert.strictEqual(report.methodAggregate.halstead.operands.distinct, 0);
            assert.lengthOf(report.methodAggregate.halstead.operands.identifiers, 0);
         });
      });
   });
}

